INSERT INTO `blog_entrada` (`identrada`, `autorid`, `titulo`, `url`, `descripcion`, `txt_entrada`, `categoriaid`, `datecreated`, `dateupdate`, `tags`, `status`) VALUES
(1, 3, 'Reto 21 dias', 'reto-21-dias', 'Reto 21 dias descripcion', '<h2>&iquest;Por qu&eacute; un reto de 21 d&iacute;as?</h2> <p>El error m&aacute;s com&uacute;n a la hora de querer perder algunos kilos antes de las vacaciones es recurrir a reg&iacute;menes nutricionales muy estrictos que al final acabar&aacute;n con tu paciencia y con tu fuerza de voluntad y te llevar&aacute;n a pensar que es mejor ganar peso que renunciar a todos los placeres de la vida.</p> <p>Piensa que si acumulas grasas es porqu&eacute;&nbsp;<strong>est&aacute;s ingiriendo m&aacute;s calor&iacute;as con respecto a las que est&aacute;s gastando</strong>. Lo que hay que hacer entonces es&nbsp;<strong>reducir las calor&iacute;as ingeridas y aumentar el gasto energ&eacute;tico diario</strong>. Si adem&aacute;s a&ntilde;adimos algunos sencillos h&aacute;bitos que te pueden&nbsp;<strong>ayudar a depurar el h&iacute;gado</strong>&nbsp;y a&nbsp;<strong>drenar la retenci&oacute;n de l&iacute;quidos</strong> tendr&aacute;s tu silueta perfecta en menos de cuatro semanas.</p> <p>Lo mejor de esta rutina que te voy a proponer hoy es que es saludable, as&iacute; que si te esfuerzas para cumplir con ella durante los 21 d&iacute;as lo m&aacute;s probable es&nbsp;<strong>que estos h&aacute;bitos se incorporen a tu vida de manera definitiva.</strong><br />Posiblemente ya sabr&aacute;s que la neurociencia ha demostrado que sirven&nbsp;<strong>21 d&iacute;as para establecer un h&aacute;bito en tu vida</strong>, ya que tu cerebro necesita este n&uacute;mero de d&iacute;as para poder incorporarlo y implementarlo con un cierto automatismo cada d&iacute;a. &nbsp;</p> <p>&nbsp;</p> <p>&nbsp;</p> <p>&nbsp;</p> <h2>&iquest;En qu&eacute; consiste mi propuesta de rutina saludable de 21 d&iacute;as?</h2> <ul> <li> <h3>1- Toma agua tibia con lim&oacute;n por la ma&ntilde;ana en ayunas</h3> </li> </ul> <p>Cada ma&ntilde;ana al despertarte, tus tejidos corporales se encuentran deshidratados y por ello requieren de&nbsp;<strong>la ingesta de l&iacute;quidos como agua o zumo para hidratarse y para eliminar las toxinas filtradas durante la noche por el h&iacute;gado</strong>.</p> <p>El <a title=\"aloe vera\" href=\"tienda/producto/3/formula-1-batido-nutricional-sabor-durazno-550g\" target=\"_blank\" rel=\"noopener\">aloe vera</a> adem&aacute;s es diur&eacute;tico y ayuda a <strong>eliminar el exceso de l&iacute;quidos adem&aacute;s de</strong>&nbsp;<strong>acelerar tu metabolismo,</strong>&nbsp;ayud&aacute;ndote a quemar m&aacute;s grasa.</p> <p>&nbsp;</p> <ul> <li> <h3>2- Haz ejercicio cada d&iacute;a un m&iacute;nimo de 30 minutos por la ma&ntilde;ana despu&eacute;s de haber tomado el zumo de lim&oacute;n.</h3> </li> </ul> <p>(&iexcl;Atenci&oacute;n! Se ha visto que las&nbsp;personas con adecuados niveles de vitamina C queman un 30% m&aacute;s grasa durante los ejercicios de alta intensidad. &iquest;Y sabes qu&eacute; es rico en vitamina C? El lim&oacute;n, claro ;))</p>', 3, '2021-05-09 14:15:42', '2022-02-03 13:06:59', 'Reto 21 dias', 1);
