(16, 16, 204, 463, 2, '123460', 'Jeans MOM con Roturas de hombre', '&lt;p&gt;Los Jeans MOM con efecto de Rotura, Amplios y comodos son perfectos para actividades diarias. Ideal para combinar con un sinfin de items de estilo streetwear o urbano informal. desvelando infinitas combinaciones faciles y versatiles, para el hombre de mil facetas que ama llevar un estilo diferente cada dia.&lt;/p&gt;\r\n&lt;p&gt;Temporada: Primavera/Verano&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Consultar por talle y colores disponibles&lt;/p&gt;', '', 'GENERICO', 'SmartWatch, do Sport, W37 Watch 7, Wearfit Pro', 20.14, 28.20, 0.00, NULL, NULL, 1, 'instock', '2021-12-14 19:55:44', '2023-04-08 20:13:47', 'jeans-mom-con-roturas-de-hombre', NULL, 'M', 'blanco,negro', '38, 40, 42, 44, 46, 48', 'T', 'algodon', '', 'urbano', 1),
