(37, 6, 166, 455, 3, '0', 'Camiseta Argentina alternativa Qatar 2022', '<p>Camisetas replicas sublimadas alusivas a la Camiseta suplente de la&nbsp; selecci&oacute;n de argentina</p>\r\n<p>Talles del S al XXL</p>', '', 'generico', '', 12.97, 18.21, NULL, NULL, NULL, 1, 'instock', '2022-10-25 13:59:52', '2023-04-08 19:31:11', 'camiseta-argentina-alternativa-qatar-2022', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 0),
(38, 13, 212, 430, 3, '0', 'Remeras Estampadas', '&lt;p&gt;Remeras estampadas de Jersey peinado&lt;/p&gt;\r\n&lt;p&gt;Talle &amp;uacute;nico abarca S M L&lt;/p&gt;\r\n&lt;p&gt;4 Colores&lt;/p&gt;\r\n&lt;p&gt;Varios dise&amp;ntilde;os&lt;/p&gt;', '', 'Generico', 'remeras, damas, estampadas, talles, unico, diseños, colores, verano', 8.53, 11.95, 0.00, NULL, NULL, 1, 'onbackorder', '2022-10-25 14:42:58', '2023-05-21 21:51:54', 'remeras-estampadas', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', 'varios', 'urbano', 1),
(39, 7, 166, 455, 3, '0', 'Bermuda MOM Blanca con Roturas', '<p style=\"line-height: 1.5;\">Para la Mujer de mil facetas que ama llevar ropa siempre diferente.</p>\r\n<p style=\"line-height: 1.5;\">Brinda confort y comodidad, perfecta para actividades cotidianas. Ideal para combinar con un sinf&iacute;n de estilos streetwear o urbano informal.</p>\r\n<ul>\r\n<li style=\"line-height: 1.5;\">G&eacute;nero: Mujer</li>\r\n<li style=\"line-height: 1.5;\">Color: Blanco</li>\r\n<li style=\"line-height: 1.5;\">Efecto: Con Flequillo y Roturas al Frente</li>\r\n<li style=\"line-height: 1.5;\">Bolsillos Traseros: Si</li>\r\n<li style=\"line-height: 1.5;\">Bolsillos Delantero: Si</li>\r\n<li style=\"line-height: 1.5;\">Tipo de short: Short</li>\r\n<li style=\"line-height: 1.5;\">Tiro del short: Alto</li>\r\n<li style=\"line-height: 1.5;\">Material principal: Jean</li>\r\n<li style=\"line-height: 1.5;\">Temporada: Primavera/Verano</li>\r\n<li style=\"line-height: 1.5;\">Talles del 36 al 44</li>\r\n</ul>', '', 'Generico', 'Bermuda, blanca, indumentaria, femenina, mujer, short, chicas', 13.62, 19.06, NULL, NULL, NULL, 1, 'instock', '2022-10-25 14:53:15', '2023-04-08 19:31:11', 'bermuda-mom-blanca-con-roturas', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 0),
(40, 16, 204, 538, 3, '0', 'Joggers de Bengalina', '&lt;p&gt;Los joggers de bengalina son la eleccion perfecta para aquellos caballeros que buscan comodidad sin sacrificar estilo. Confeccionados en un material suave y elastico, cuentan con bolsillos estilo chino y un tiro bajo que le dan un toque urbano.&lt;/p&gt;\r\n&lt;p&gt;Ademas, el pu&amp;ntilde;o en el tobillo los hace ideales para combinar con zapatillas y crear un outfit streetwear en tendencia. Disponibles en diferentes colores y tallas para adaptarse a cualquier gusto y preferencia.&lt;/p&gt;\r\n&lt;p&gt;Consultar por talles y colores disponibles&lt;/p&gt;', '&lt;p&gt;&amp;lt;p&amp;gt;&amp;amp;lt;ul&amp;amp;gt; &amp;amp;lt;li style=&quot;line-height: 1.5;&quot;&amp;amp;gt;Tipo:&amp;amp;amp;nbsp;Largo&amp;amp;lt;/li&amp;amp;gt; &amp;amp;lt;li style=&quot;line-height: 1.5;&quot;&amp;amp;gt;G&amp;amp;amp;eacute;nero: Hombre&amp;amp;lt;/li&amp;amp;gt; &amp;amp;lt;li style=&quot;line-height: 1.5;&quot;&amp;amp;gt;Material principal:&amp;amp;amp;nbsp;Bengalina&amp;amp;lt;/li&amp;amp;gt; &amp;amp;lt;li style=&quot;line-height: 1.5;&quot;&amp;amp;gt;Modelo:&amp;amp;amp;nbsp;Jogger&amp;amp;lt;/li&amp;amp;gt; &amp;amp;lt;li style=&quot;line-height: 1.5;&quot;&amp;amp;gt;Corte del pantal&amp;amp;amp;oacute;n:&amp;amp;amp;nbsp;Chupin&amp;amp;lt;/li&amp;amp;gt; &amp;amp;lt;li style=&quot;line-height: 1.5;&quot;&amp;amp;gt;Tiro del pantal&amp;amp;amp;oacute;n:&amp;amp;amp;nbsp;Tiro bajo&amp;amp;lt;/li&amp;amp;gt; &amp;amp;lt;li style=&quot;line-height: 1.5;&quot;&amp;amp;gt;Temporada:&amp;amp;amp;nbsp;Primavera/Verano&amp;amp;lt;/li&amp;amp;gt; &amp;amp;lt;li style=&quot;line-height: 1.5;&quot;&amp;amp;gt;Colores: Gris, verde, Bord&amp;amp;amp;oacute;, Beige, Negro&amp;amp;lt;/li&amp;amp;gt; &amp;amp;lt;/ul&amp;amp;gt;&amp;lt;/p&amp;gt;&lt;/p&gt;', 'generico', '', 13.31, 18.64, 0.00, NULL, NULL, 1, 'instock', '2022-10-25 15:01:38', '2023-04-08 21:06:52', 'joggers-de-bengalina', NULL, 'M', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
(41, 13, 212, 430, 3, '0', 'Remerones animados', '&lt;p&gt;Elaborado en Algod&amp;oacute;n,&lt;span class=&quot;ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD&quot;&gt; de manga&lt;/span&gt; Corta y&amp;nbsp;&lt;span class=&quot;ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD&quot;&gt; cuello&lt;/span&gt;&amp;nbsp;Redondo&lt;/p&gt;\r\n&lt;p&gt;Ideal ya sea para estar en tu casa haciendo fiaca, salir a pasar el rato, andar en bici o para aquello que m&amp;aacute;s le guste.&lt;/p&gt;', '', 'CLGropa', 'Remerones, sublimados, spum, premium, damas, mujer, indumentaria, femenina, chicas', 10.03, 14.04, 0.00, NULL, NULL, 1, 'onbackorder', '2022-10-25 15:04:29', '2023-05-21 21:51:50', 'remerones-animados', NULL, 'F', '', 'Unico (equivalente M)', 'T', 'algodon', 'varios', 'urbano', 1),
(42, 16, 204, 463, 3, '0', 'Jeans Lisos Elastizados de Hombre', '&lt;p style=&quot;line-height: 1;&quot;&gt;Los Jeans Lisos Elastizados brindan al usuario comodidad, perfecto para actividades diarias. Ideal para combinar con un sinf&amp;iacute;n de &amp;iacute;tems de estilo streetwear o urbano informal.desvelando infinitas combinaciones f&amp;aacute;ciles y vers&amp;aacute;tiles, para el hombre de mil facetas que ama llevar un estilo diferente cada d&amp;iacute;a.&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;line-height: 1.5;&quot;&gt;G&amp;eacute;nero: Hombre&lt;/li&gt;\r\n&lt;li style=&quot;line-height: 1.5;&quot;&gt;Material principal: Jean&lt;/li&gt;\r\n&lt;li style=&quot;line-height: 1.5;&quot;&gt;Temporada: Primavera/Verano&lt;/li&gt;\r\n&lt;li style=&quot;line-height: 1.5;&quot;&gt;Con bolsillos: S&amp;iacute;&lt;/li&gt;\r\n&lt;li style=&quot;line-height: 1.5;&quot;&gt;Talles del 38 al 48&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;div style=&quot;line-height: 1;&quot;&gt;Consultar por talle y colores disponibles&lt;/div&gt;', '', 'generico', 'bermuda, indumentaria, masculina, jean, primavera, verano, elastizado', 20.14, 28.20, 0.00, NULL, NULL, 1, 'instock', '2022-10-25 15:24:43', '2023-04-08 19:31:11', 'jeans-lisos-elastizados-de-hombre', NULL, 'M', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
(43, 13, 212, 2967, 3, '0', 'Chalecos de lanilla morley', '<p>Chalecos Morley de lanilla&nbsp;</p>\r\n<p>Chaleco de morley. infaltable esta temporada. Perfecto para combinar con tu remera o camisa favorita.</p>\r\n<p>Talle Unico</p>', '', 'Generico', 'Chalecos, chicas, damas, mujeres, indumentaria, femenina, morley, lanilla', 7.44, 10.42, 0.00, NULL, NULL, 1, 'onbackorder', '2022-10-25 15:25:22', '2023-05-21 21:51:47', 'chalecos-de-lanilla-morley', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
(44, 17, 5598, 454, 3, '0', 'Buzos largos de lanilla y lanilla morley', '<p>Buzos largos de lanilla y lanilla morley<br>&bull; Remerones tipo sweaters<br>&bull; Talles XL XXL<br>&bull; Varios colores</p>\r\n<p>&nbsp;</p>', '', 'Generico', 'Buzos, damas, lanilla, mujer, morley, indumentaria, remerones, sweters, talles, colores, chicas, moda, temporada', 9.18, 12.86, 0.00, NULL, NULL, 1, 'instock', '2022-10-25 15:30:42', '2023-04-08 19:38:18', 'buzos-largos-de-lanilla-y-lanilla-morley', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon y poliester con friza', '', 'urbano', 1),
