(67, 7, 166, 455, 3, '0', 'Pantalon Cargo de Bengalina Elastizada para Damas', '<p>Dise&ntilde;ado para damas y confeccionado en Gabardina elastizada cuenta con cintura elastica con nudo para mayor ajuste y comodidad, demas de los tradicionales bolsillos traseros y delanteros tiene unos practicos bolsillos laterales con solapa, ideal para actividades cotidianas. El pu&ntilde;o en el tobillo lo hace perfectos para combinar y lucir tus zapatillas favoritas.</p>\r\n<p>Es simplemente perefecto para complementar cualquier look urbano informal o estilo streetwear.</p>\r\n<div class=\"stext-102 cl3 p-t-23 container-tinymce mce-content-body\">\r\n<p><strong>Consultar por talles y colores disponibles</strong></p>\r\n</div>', '<ul>\r\n<li>G&eacute;nero: Mujer.</li>\r\n<li>Color: verde, negro, gris, azul y beige.</li>\r\n<li>Tipo: Cargo.</li>\r\n<li>Tiro: medio.</li>\r\n<li>Corte: Chup&iacute;n.</li>\r\n<li>Bolsillos Traseros: si.</li>\r\n<li>Bolsillos Delantero: Si.</li>\r\n<li>Bolsillos Laterales: Si.</li>\r\n<li>Material principal: Bengalina Elaztizada.</li>\r\n<li>Temporada: Primavera/Verano.</li>\r\n<li>Talles del 38 al 46. G&eacute;nero: Mujer.</li>\r\n</ul>', 'Generico', 'pantalon, cargo, bengalina, damas, verano, urbano', 14.66, 19.06, 0.00, NULL, NULL, 1, 'instock', '2022-11-19 09:54:37', '2023-04-08 19:31:11', 'pantalon-cargo-de-bengalina-elastizada-para-damas', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
