(71, 13, 212, 430, 2, '0', 'Remera de modal viscosa con escote V y puntilla vane', '&lt;p&gt;Esta remera con escote en V es un cl&amp;aacute;sico que nunca pasar&amp;aacute; de moda.&lt;/p&gt;\r\n&lt;p&gt;Est&amp;aacute; confeccionada en modal viscosa y cuenta con un detalle de puntilla que la hace destacar.&lt;/p&gt;\r\n&lt;p&gt;Es una opci&amp;oacute;n perfecta tanto para eventos formales como informales, por lo que se convierte en una prenda imprescindible en cualquier guardarropa.&lt;/p&gt;', '&lt;p dir=&quot;ltr&quot;&gt;MEDIDAS APROXIMADAS: Medimos en plano solo frente sin estirar!&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li dir=&quot;ltr&quot;&gt;TALLE (2): Busto (de axila a axila):&amp;nbsp; 41&amp;nbsp;cm / Largo frente 55&amp;nbsp;cm Largo atr&amp;aacute;s: 56&amp;nbsp; cm / Ancho mangas 14&amp;nbsp;cm&lt;/li&gt;\r\n&lt;li dir=&quot;ltr&quot;&gt;TALLE (3): Busto (de axila a axila): 44&amp;nbsp;cm / Largo frente: 58&amp;nbsp; cm / Largo atr&amp;aacute;s: 59 cm / Ancho mangas 15&amp;nbsp;cm&lt;/li&gt;\r\n&lt;li dir=&quot;ltr&quot;&gt;TALLE (4): Busto (de axila a axila):&amp;nbsp; 46&amp;nbsp;cm / Largo frente 56&amp;nbsp;cm Largo atr&amp;aacute;s: 57 cm / Ancho mangas 16&amp;nbsp;cm&lt;/li&gt;\r\n&lt;li dir=&quot;ltr&quot;&gt;TALLE (5): Busto (de axila a axila): 48&amp;nbsp;cm / Largo frente: 60&amp;nbsp;cm / Largo atr&amp;aacute;s: 61 cm / Ancho mangas 17&amp;nbsp;cm&lt;/li&gt;\r\n&lt;/ul&gt;', 'Generico', 'remera, modal, escote V, puntilla, vane, primavera, verano, otoño, invierno', 4.75, 9.50, 0.00, NULL, NULL, 1, 'onbackorder', '2022-12-10 17:12:39', '2023-05-21 21:51:25', 'remera-de-modal-viscosa-con-escote-v-y-puntilla-vane', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
(72, 13, 212, 430, 2, '0', 'Remera Clasica De Mujer con Botones en Escote', '<p>Las remeras de siempre que van bien con todo!!</p>\r\n<p>Remera B&aacute;sica con Botones en escote&nbsp;<br><br>Material: Modal Viscosa</p>\r\n<p>Talle &uacute;nico</p>\r\n<p>MEDIDAS<br>- Ancho (Sisa a Sisa): 38cm<br>- Largo: 53cm<br>- Mangas: 10cm</p>', '', 'Generico', 'Basicas, Casual, Clasico, Diario, Primavera, Salir, Verano, Modal, Viscosa', 4.75, 9.50, 0.00, NULL, NULL, 1, 'onbackorder', '2022-12-10 22:55:10', '2023-05-21 21:51:22', 'remera-clasica-de-mujer-con-botones-en-escote', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
(73, 18, 2271, 443, 2, '0', 'Vestido manga corta con bolsillo', '<p>C&oacute;modo vestido de algod&oacute;n ajustado en la zona superior y suelto en la zona inferior lo que le da un estilo fresco y con libertad de movimiento</p>\r\n<p>Talle &uacute;nico<br>&nbsp;sede asta un talle 3 - 4</p>', '', 'Generico', 'Vestido, manga, corta, bolsillo, algodon, primavera, verano,fresco, libre', 4.75, 9.50, NULL, NULL, NULL, 1, 'instock', '2022-12-11 00:05:34', '2023-04-08 19:31:11', 'vestido-manga-corta-con-bolsillo', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
(74, 18, 2271, 443, 2, '0', 'Vestido Manga Larga Morley con Frunce a los Costados', '<p>Vestido manga larga de morley elastizado con tiras frunce laterales y cuello 1/2 polera.</p>\r\n<p>Talles 2 al 5&nbsp;<br>Gris &nbsp;claro y oscuro&nbsp;<br>verde militar &nbsp;. Rosa viejo y negro</p>', '<ul class=\"ui-pdp-list__wrapper\">\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">G&eacute;nero</span>: Mujer</p>\r\n</li>\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Material principal</span>: Morley</p>\r\n</li>\r\n</ul>\r\n<ul class=\"ui-pdp-list__wrapper\">\r\n<li class=\"ui-pdp-list__item\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Ocasi&oacute;n</span>: Casual</li>\r\n</ul>\r\n<ul class=\"ui-pdp-list__wrapper\">\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Tipo de largo</span>: Muslo</p>\r\n</li>\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Tipo de manga</span>: Larga</p>\r\n</li>\r\n</ul>\r\n<ul class=\"ui-pdp-list__wrapper\">\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Tipo de cuello</span>: Cubierto (1/2 polera)</p>\r\n</li>\r\n</ul>', 'Generico', 'Vestido, Manga Larga, Morley, Frunce, Costados, tiras, primavera', 6.33, 12.66, 11.00, NULL, NULL, 1, 'instock', '2022-12-11 08:44:46', '2023-04-08 19:31:11', 'vestido-manga-larga-morley-con-frunce-a-los-costados', NULL, 'F', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
(75, 16, 166, 455, 2, '0', 'Bermuda Mom Azul con Roturas y Flequillos', '<div class=\"ui-pdp-list ui-pdp-specs__list\">\r\n<p>Bermuda de jeans con efecto de rotura y flequillos, perfecto para actividades diarias.</p>\r\n<p>Vers&aacute;tiles y f&aacute;ciles de combinar, las bermudas de jeans desvelan infinitas combinaciones posibles, para el hombre de mil facetas que ama llevar ropa siempre diferente. Ideal para combinar con un sinf&iacute;n de &iacute;tems al estilo streetwear o urbano informal.</p>\r\n</div>\r\n<p>&nbsp;</p>', '<div class=\"ui-pdp-list ui-pdp-specs__list\">\r\n<ul class=\"ui-pdp-list__wrapper\">\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">G&eacute;nero</span>: Hombre</p>\r\n</li>\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Tipo de short</span>: Bermuda</p>\r\n</li>\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Tiro del short</span>: Medio</p>\r\n</li>\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Material principal</span>: Jean</p>\r\n</li>\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Composici&oacute;n</span>: Jean</p>\r\n</li>\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-sizeXSMALL ui-pdp-familyBOLD\">Temporada de lanzamiento</span>: Primavera/Verano</p>\r\n</li>\r\n<li class=\"ui-pdp-list__item\">\r\n<p class=\"ui-pdp-familyREGULAR ui-pdp-list__text\"><span class=\"ui-pdp-colorBLACK ui-pdp-si