(78, 15, 212, 459, 2, '0', 'Sueter Bremer Morley Viscosa', '<p>Su&eacute;ter perfecto para oto&ntilde;o/invierno!</p>\r\n<p>Elaborado en Morley Viscosa, un material suave y c&oacute;modo que te mantendr&aacute; abrigado en los d&iacute;as frescos.</p>\r\n<p>Su cuello redondo permite adaptarse a un estilo formal o informal y es la elecci&oacute;n perfecta para complementar cualquier atuendo, ya sea para ir al trabajo o para una salida casual.</p>\r\n<p>Talles disponibles desde 1 hasta 5</p>', '', 'GENERICO', 'hombre, caballero, morley, otoño', 7.69, 15.38, 0.00, NULL, NULL, 1, 'instock', '2023-02-13 13:46:37', '2023-04-08 19:31:11', 'sueter-bremer-morley-viscosa', NULL, 'M', 'blanco,negro', 'S,M,L', 'T', 'algodon', '', 'urbano', 1),
